webpackJsonp([0x87a595ba97bf],{351:function(e,t){e.exports={data:{markdownRemark:{html:'<h1>Kinectron</h1>\n<h2>A Realtime Peer Server for Kinect 2</h2>\n<blockquote>\n<p><a href="http://lisajamhoury.com/">Lisa Jamhoury</a>, ITP 2017<br>\n<a href="https://github.com/vanevery">Shawn Van Every</a>, ITP  </p>\n<blockquote>\n<p>Additional collaborators: <a href="http://anothersideproject.co/">Stephanie Koltun</a>, <a href="www.orfleisher.com">Or Fleisher</a> and <a href="http://montoyamoraga.io/">Aar√≥n Montoya-Moraga</a>  </p>\n</blockquote>\n</blockquote>\n<blockquote>\n<p>2017</p>\n</blockquote>\n<p>Kinectron is a node-based library that broadcasts Kinect2 data over a peer connection. It builds on the Node Kinect2 and PeerJS libraries.<br>\nKinectron sends Kinect depth, color and skeletal data over a peer network. It can be used in a number of ways.<br>\nKinectron has two components--an electron application to broadcast Kinect2 data over a peer connection, and a client-side API to request and receive Kinect2 data over a peer connection.  </p>\n<p><a class="btn btn-outline-primary" href="https://kinectron.github.io/" role="button">Project Page</a>   <a class="btn btn-outline-primary" href="https://github.com/kinectron/kinectron" role="button">GitHub Repository</a>  </p>',frontmatter:{title:"Kinectron",date:"May 23, 2018",path:"/kinectron",tags:["Tool"],excerpt:"Kinectron is a node-based library that broadcasts Kinect2 data over a peer connection. It builds on the Node Kinect2 and PeerJS libraries."}}},pathContext:{prev:null,next:{html:'<h1>Gravity</h1>\n<h2>Immersive installation</h2>\n<blockquote>\n<p><a href="http://wangxinyao-design.com/">Xinyao Wang</a><br>\n2017</p>\n</blockquote>\n<iframe src="https://player.vimeo.com/video/216230174" width="640" height="360" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>\n<p><a href="https://vimeo.com/216230174">Gravity</a> from <a href="https://vimeo.com/user33557684">Xinyao Wang</a> on <a href="https://vimeo.com">Vimeo</a>.</p>\n<p>Gravity allows users to play in an magical version of mundane moments, where their movements can control the rules of physics. Combining simplified motion-capture suits, indoor position and projection mapping technology, users move their bodies to control objects in zero gravity. Working together they can change the world visually and aurally.</p>\n<p>Toolkit: Unreal Engine, Openframework, Kinect, OSC, Socket.io, Android Studio, Syphon, Spout, TCP Syphon, TCP Spout, Motion Capture Suit, Resolume.\n<br>\n<a class="btn btn-outline-primary" href="https://annekgoodfriend.github.io/Bootstrap_villageLIVE/" role="button">Project Page</a></p>',id:"/home/travis/build/ITP-xStory/website/src/pages/projects/gravity.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2017-01-30T12:34:00+00:00",thumbnail:"https://imgur.com/download/6cDzdkk",path:"/gravity",title:"Gravity",excerpt:"Gravity allows users to play in an magical version of mundane moments, where their movements can control the rules of physics.",tags:["Experience","Immersive"]}}}}}});
